import React from "react";
import "./footer.scss";
import TopLogo from "../../assets/img/top-logo.svg"

const Footer = () => {
    return (
    
        <div>
            <div className="container">
            <p>
            2020 all rights reserved.
            </p>

            <img src={TopLogo} alt="logo 25watts" />
            </div>
        </div>

        
        
    );
};

export default Footer
